import styled from "styled-components";
import Theme from "../../theme";


const ArtistListCont = styled.section `
    background-color: ${props => props.theme.colors.secondary};
    margin: 2%;
    overflow: hidden;
    padding: 0;
    border-radius: 15px;
`

const Encontrados = styled.h2 `
    text-align: center;
`

export {
    ArtistListCont,
    Encontrados,
}
